import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import LineRasterizer from './LineRasterizer.tsx';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={LineRasterizer} />
      </Switch>
    </Router>
  );
};

export default App;
